import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsx mdx */



const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1>{`The Diabetes Plate Method`}</h1>
    <p><img parentName="p" {...{
        "src": "https://www.diabetes.org/sites/default/files/inline-images/AtE_plate-method-vector_1787742770.jpg",
        "alt": null
      }}></img></p>
    <p>{`The diabetes plate method is one of the easiest ways to meal plan. It is a visual guide to meal planning for the right portions of foods to manage your calorie needs from foods.`}</p>
    <p>{`Tip: Start by using a 9 inch size plate. If your dinner plate is too large, you may use a salad plate.`}</p>
    <p><img parentName="p" {...{
        "src": "https://www.diabetesfoodhub.org/system/user_files/Images/ADA-Diabetes-Plate-Method_step-1.png",
        "alt": null
      }}></img></p>
    <p>{`Vegetables are classified into two groups: “non-starchy” or “starchy”.`}</p>
    <p>{`Non-starchy vegetables have much water and natural fiber (or pulp) that helps stabilize blood sugars. They have about one-third of carbohydrate compared to starchy vegetables.`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
